import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
let hr=0,min=0,sec=0,mil=99;

setInterval(()=>{


  if (mil < 99) {
    mil++;
  }
  else {
    mil = 0;
    if (sec < 59) {
        sec++;
    } else {
        sec = 0;
        if (min < 59) {
            min++;
        } else {
            min = 0;
            if (hr < 59) {
                hr++;
            }
        }
    }
  }
  console.log(hr,min,sec,mil);

const element=(<div>
  <div id="stopwatch">
    <p id="stopHour">{hr}</p>
  :
  <p id="stopMinute">{min}</p>
  :
  <p id="stopSecond">{sec}</p>:
  <p  id="stopMilisecond">{mil}</p>
  </div>
  <div id="stopwatchBtn">
  <button id="btnStopwatch">Start</button></div></div>
  );
},10)

root.render(element);
